DROP TABLE IF EXISTS `work_force`;
CREATE TABLE `work_force` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `fs_id` int(10) unsigned NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `time` int(11) NOT NULL,
  `cost` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `work_force_fs_id_foreign` (`fs_id`),
  CONSTRAINT `work_force_fs_id_foreign` FOREIGN KEY (`fs_id`) REFERENCES `feasibility_study` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC;

